/* showMore */
function showMore(containerSelector, initialItems = 6, incrementItems = 3) {
  const container = document.querySelector(containerSelector);
  if (!container) return;

  const showMoreBtn = container.querySelector('.show-more__btn');
  const showMoreItems = container.querySelectorAll('.show-more__item').length;
  let items = initialItems;

  showMoreBtn.addEventListener('click', () => {
    items += incrementItems;
    const array = Array.from(container.querySelector('.show-more__list').children);
    const visibleItems = array.slice(0, items);

    visibleItems.forEach(el => el.classList.add('visible'));

    if (visibleItems.length === showMoreItems) {
      showMoreBtn.style.display = 'none';
    }
  });
}
showMore('#showMore1');
/* showMore */




/* nav active localStorage */ /* Ð¿ÐµÑÐµÐ´ÐµÐ»Ð°ÑÑ ÐºÐ¾Ð³Ð´Ð° Ñ Ð¿ÐµÑÐµÑÐ¾Ð¶Ñ Ð½Ð° ÑÑÐ°ÑÐ½Ð¸ÑÑ Ð¾Ð¿ÑÐ¸Ð´ÐµÐ»ÐµÐ½ÑÑ Ð¿Ð¾Ð´ÑÐ²ÐµÑÐ¸Ð²Ð°ÑÑ ÑÐ¾ÑÐ¶Ðµ nav Ð±ÐµÐ· Ð»Ð¾ÐºÐ°Ð»Ð° ÑÑÐ¾ÑÐµÐ´Ð¶Ð° */
const navLocalStorege = () => {
  let navLink = document.querySelectorAll('.menu__list-link');
  let logo = document.querySelector('.custom-logo-link');

  navLink.forEach((item) => {
    item.addEventListener('click', (event) => {
      navLink.forEach((link) => link.classList.remove('menu__list-link--active'));
      item.classList.add('menu__list-link--active');
      localStorage.setItem('activeLink', event.target.getAttribute('href'));
    });
  });

  window.addEventListener('DOMContentLoaded', () => {
    const currentUrl = window.location.href;

    const activeLink = localStorage.getItem('activeLink');

    if (activeLink) {
      const activeElement = document.querySelector(`.menu__list-link[href="${activeLink}"]`);
      if (activeElement) {
        document.querySelectorAll('.menu__list-link').forEach((link) => link.classList.remove('menu__list-link--active'));
        activeElement.classList.add('menu__list-link--active');
      }
    } else if (currentUrl === 'https://marcho/') {

      const homeLink = document.querySelector('.menu__list-link[href="https://marcho/"]');
      if (homeLink) {
        homeLink.classList.add('menu__list-link--active');
      }
    }
  });

  logo.addEventListener('click', () => {

    navLink.forEach((item) => {
      item.classList.remove('menu__list-link--active');
    });

    const homeLink = document.querySelector('.menu__list-link[href="https://marcho/"]');
    if (homeLink) {
      homeLink.classList.add('menu__list-link--active');
    }
    localStorage.removeItem('activeLink');

    window.location.href = 'https://marcho/';
  });
}
navLocalStorege();
/* nav active localStorage */



/* model */
function bindModal(trigger, modal, close) {
  trigger = document.querySelector(trigger),
    modal = document.querySelector(modal),
    close = document.querySelector(close)

  const body = document.body

  trigger.addEventListener('click', e => {
    e.preventDefault()
    modal.style.display = 'flex'
    body.classList.add('locked')
  });
  close.addEventListener('click', () => {
    modal.style.display = 'none'
    body.classList.remove('locked')
  });
  modal.addEventListener('click', e => {
    if (e.target === modal) {
      modal.style.display = 'none'
      body.classList.remove('locked')
    }
  })
}

