/* search active */
const search = () => {
  const searchBtn = document.querySelector('.search__btn-clouse');
  const search = document.querySelector('.search');
  const searchImage = document.querySelector('.navigation__search');


  searchBtn.addEventListener('click', () => {
    search.classList.remove('active')
  })
  searchImage.addEventListener('click', () => {
    search.classList.add('active')

  })
}
search();
/* search active */

/*likeCount */
const likeCount = () => {
  const productLike = document.querySelectorAll('.product-item__link-liked');
  const likedSum = document.querySelector('.user-nav__num');
  const likedArr = [];

  productLike.forEach((item) => {
    item.addEventListener('click', (e) => {
      e.preventDefault(); 
      if (!item.classList.contains('liked')) {
        likedArr.push(item);
        item.classList.add('liked');
      }
      likedSum.textContent = likedArr.length
    });
  });
};

likeCount();
/*likeCount */

/*basketCount */
const basketCount = () =>{
  const basketSum = document.querySelector('.user-nav__basket');
  const productBasket = document.querySelectorAll('.product-item__link-cart');
  const basketArr = [];

  productBasket.forEach((item) => {
    item.addEventListener('click', (e) => {
      e.preventDefault(); 
      if (!item.classList.contains('cart')) {
        basketArr.push(item);
        item.classList.add('liked');
      }
      basketSum.textContent = basketArr.length
    })
  })
  
}
basketCount();
